import React from "react";

const SearchBox = ({handleSearch}) =>{

    return(
        <div className="search">
                <input 
                onChange={(event)=>handleSearch(event.target.value)}
                type="text" placeholder="Type to search..."/>
        </div>
    )
}

export default SearchBox
